WebANews.Models.News = Backbone.Model.extend({});

WebANews.NewsRouter = Backbone.Router.extend({
    routes:{
        "":"index",
        "news/:id": "news"
    },
    initialize: function(){
        this.jsonData = {},
        this.newsCollection = new WebANews.Collections.News();
        this.newsView = new WebANews.Views.News({collection : this.newsCollection });

        Backbone.history.start();
    },
    index: function(){
        console.log("Estoy en el index");
        //Cargamos  toda la informacion que los de backend nos dan
        //Insertamos los datos en la coleccion generando su respectivo model

        this.loadData();
    },
    news : function(id){
        self = this;
        console.log("Consultando la noticia: "+id);
        $(".noticia").remove();
            $.getJSON("allformated.json").then(function(data){
            self.jsonData = data;
            console.log(data);
        var fullNew = new WebANews.Views.ContentNotice({
            model: new WebANews.Models.News({
                id:id,
                title: data[id].title,
                content: data[id].content,
                summary: data[id].summary,
                image: data[id].image,
                author : data[id].author,
                date: data[id].date
            })
        });

        fullNew.render();
        $(".noticias").append(fullNew.el);
            });
    },

    loadData:function(){
        var self = this;

        return $.getJSON("allformated.json").then(function(data){
            self.jsonData = data;

            for (var id in data){
                if (data.hasOwnProperty(id)){
                    self.addNews(id, data[id])
                }
            }
        });

    },

    addNews: function(id, news){
        this.newsCollection.add(new WebANews.Models.News({
            id : id,
            title: news.title,
            summary: news.summary,
            content: news.content,
            image: news.image,
            author: news.author,
            date: news.date
        }));
    }
});

WebANews.application = new WebANews.NewsRouter();

WebANews.Views.ContentNotice = Backbone.View.extend({
template : Handlebars.compile($("#fullNew").html()),
render: function(){
this.$el.append(this.template(this.model.toJSON()));
},
events:{
    "click #return":"return"
},
    "return" : function(){
        WebANews.application.navigate("",{trigger:true});
    }
});

WebANews.Views.News = Backbone.View.extend({
    el: $(".noticias"),
    template: Handlebars.compile($("#tplNews").html()),
    render:function(){
        this.collection.forEach(this.addOneNews, this);
    },

    initialize: function(){
        console.log(this.collection);
        this.listenTo(this.collection, "add", this.addOneNews, this);
    },

    addOneNews: function(news){
       this.$el.append()
        var newsView = new WebANews.Views.SingleNews({model:news, el:this.$el});
        newsView.render();
        this.$el.append(newsView.el);
    }
});

WebANews.Views.SingleNews = Backbone.View.extend({
    template: Handlebars.compile($("#single-news").html()),
    render:function(){
        this.$el.append(this.template(this.model.toJSON()));
    },
    events: {
        "click .leer_mas": "leer_mas"
    },
    leer_mas : function(e){
        if (e.target.id == this.model.get("id")){
            this.navigate(this.model.get("id"));
            return false;
        }
    },
    navigate : function(id){
        WebANews.application.navigate("news/"+id,{trigger: true});
    }
});

var WebANews={
    Models: {},
    Views: {},
    Collections:{},
    Router:{}
};

window.WebANews = WebANews;

var WebANews={};
WebANews.NewsModel = Backbone.Model.extend({});

WebANews.NewsView = Backbone.View.extend({
    tagName : "article",
    className : "noticia",
    template : Handlebars.compile($("#tplNews").html()),
    render : function(){
        //var news = this.model;
        //var title = news.get("title");
        //var image = news.get("image");
        //var date = news.get("date");
        //var content = news.get("content");
        //var author = news.get("author");

        //this.$el.html("<h3 class='titulo'>"+title+"</h3>"+
        //             "<figure><img src='"+image+"'>"+
        //             "<figcaption>"+date+"</figcaptio>"+
        //             "</figure><div class='contenido'>"+
        //             content+"</div><p class='autor'>"+
        //    author+"</p><a class='leermas'>Leer mas</a>");
        this.$el.html(this.template(this.model.toJSON()));
    }
});

WebANews.NewsCollection = Backbone.Collection.extend({
    model:WebANews.NewsModel
});

WebANews.NewsRouter = Backbone.Router.extend({
    routes: {
        "" : "index",
        "news/:id" : "noticia",
        "profile/:username" : "profile"
    },
    index : function(){
        console.log("Est√°s en el index");
    },
    noticia: function(id){
        console.log("Quieres ver la noticia: "+id);
    },
    profile: function(username){
        console.log("Viendo el perfil de: "+username);
    }
});

WebANews.application = new WebANews.NewsRouter();
Backbone.history.start();

window.WebANews = WebANews;

WebANews.Collections.News = Backbone.Collection.extend({
    model: WebANews.Models.News
});

